function Navigation() {
  return (
    <div className="nav">
      <img src='./mainyouflex.JPG' width= "200%" alt="Home" />
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
    </div>
  );
}

export default Navigation;
